List of Wonders','http://www.listofwonders.com/wp-content/uploads/2013/06/Taj-Mahal3.jpg','Shah Jahan was emperor during one of the most prosperous periods in the Mughal Empire\'s history. In 1631, the beloved third wife of Shah Jahan, Mumtaz Mahal, passed away while giving birth to their 14th child. To show his love for Mumtaz, Shah Jahan comissioned the building of the most beautiful and magnificant masoleum. Taj Mahal in 1860 Photo by: Samuel Bourne Construction on the Taj Mahal began in 1632 and continued for 22 years until it was completed around 1653. Shah Jahan employed several architects to design the Taj Mahal, but Ustad Ahmad Lahauri is considered to be the lead architect. The Taj Mahal\'s design is a blend of traditional Persian and earlier Mughal architecture. Many older buildings were constructed using red sandstone, but Shah Jahan preferred the use of white marble accented with semi-precious jewels in his buildings. Over 20,000 workers were used to build the Taj Mahal, while over 1,000 elephants pulled the heavy blocks of marble to the construction site.','no Author','no Author','',NULL,'2015-12-03 05:39:53','2015-12-03 05:39:53',1,0,''),(5606,5607,'Sri Srinivasa Perumal Temple in Little India, Singapore','http://www.listofwonders.com/wp-content/uploads/2015/01/Sri-Srinivasa-Perumal-Temple.jpg','Sri Srinivasa Perumal Temple located in Serangoon area in Singapore. Serangoon area is considered as a little Indian where a large number of Indians inhabited settle there from 19th century. This is the only Hindu temple located in Singapore preserving and enriching Indian culture.','no Author','no Author','',NULL,'2015-12-03 05:39:53','2015-12-03 05:39:53',2,0,''),(5607,5608,'Most Beautiful Places In The World - List of Wonders','http://www.listofwonders.com/wp-content/uploads/2013/05/mont-everes.jpg','Without a doubt, there are a number of truly beautiful places around the world that only some of us will be lucky enough to see more than one of them in our lifetime. The following is a list of the most breathtaking places spread across the world to see that will amaze you and inspire you with its beauty. Ha Long Bay, Vietnam Ha Long Bay, Vietnam Located in the Va Don district of Vietnam, this picturesque bay is known around the world for its stunning views and its thousands of limestone karsts varying in shape and size. Having records of prehistoric people living here thousands of years ago, the bay is filled with thousands of monolithic islands in the bay in a dense cluster. While for visiting tourists it is a place of unparalleled tranquility and serenity, to others it is their home as the bay is inhabited by four small fishing villages adding up to 1,600 people. A place that is of great importance to the history and folkore of its country, it is a must see destination to anyone','no Author','no Author','',NULL,'2015-12-03 05:39:53','2015-12-03 05:39:53',3,0,''),(5608,5609,'Top 10 Must-Visit Cities in South India - List of Wonders','http://www.listofwonders.com/wp-content/uploads/2014/06/Warangal-temple.jpg','India is known for its rich and diverse culture. However, whole of India â€“ from Kashmir to Kanyakumari â€“ is beautiful in different ways; each and every region has something special about it. North is different from South, and East from West. Whether you are an Indian or a foreigner who is visiting India, we let you know 10 must-visit cities in its southern side. Do check these places out whenever visiting South India! Hereâ€™s the list! Top 10 Must-Visit Cities in South India: 1 Warangal apalltemples.com Located in Telangana region of A.P., it is at a distance of around 150 kilometers from Hyderabad. The place is known for its ancient temples and beautiful lakes. There are many other places to see in Warangal. 2 Kochi shubhttc.com Kochi is full of golf clubs, beaches, mosques, parks, and beautiful churches. This place is known as the queen of the Arabian Sea. Festivals celebrated in Kochi are known for its pomp