/*Table structure for table `link_setting` */

DROP TABLE IF EXISTS `link_setting`;

CREATE TABLE `link_setting` (
  `link_setting_id` int(11) NOT NULL AUTO_INCREMENT,
  `link_id` int(11) DEFAULT NULL,
  `setting_id` int(11) DEFAULT NULL,
  `status` tinyint(4) DEFAULT '1',
  `created_date` datetime DEFAULT NULL,
  `updated_date` datetime DEFAULT NULL,
  PRIMARY KEY (`link_setting_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `link_setting` */

/*Table structure for table `login_link_expired` */

DROP TABLE IF EXISTS `login_link_expired`;

CREATE TABLE `login_link_expired` (
  `login_expired_id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) DEFAULT NULL,
  `status` tinyint(4) DEFAULT NULL COMMENT '1-verified 0-not verified',
  PRIMARY KEY (`login_expired_id`)
) ENGINE=MyISAM AUTO_INCREMENT=107 DEFAULT CHARSET=latin1;

/*Data for the table `login_link_expired` */

insert  into `login_link_expired`(`login_expired_id`,`user_id`,`status`) values (106,145,1),(105,144,1),(104,143,1),(103,140,1),(102,139,0),(101,137,0);

/*Table structure for table `loyalities` */

DROP TABLE IF EXISTS `loyalities`;

CREATE TABLE `loyalities` (
  `loyality_id` int(11) NOT NULL AUTO_INCREMENT,
  `user_category_id` int(11) NOT NULL,
  `user_id` int(11) NOT NULL,
  `loyality_type` varchar(20) DEFAULT NULL COMMENT '(Faviorate,usefull,like)',
  `status` tinyint(1) DEFAULT NULL COMMENT '1-active, 0-inactive',
  `created_date` datetime DEFAULT NULL,
  `update_date` datetime DEFAULT NULL,
  PRIMARY KEY (`loyality_id`,`user_category_id`,`user_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `loyalities` */

/*Table structure for table `order_status` */

DROP TABLE IF EXISTS `order_status`;

CREATE TABLE `order_status` (
  `id` varchar(10) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `order_status` */

insert  into `order_status`(`id`) values ('cancelled'),('new'),('refund'),('refunded'),('shipped');

/*Table structure for table `orders` */

DROP TABLE IF EXISTS `orders`;

CREATE TABLE `orders` (
  `id` text NOT NULL,
  `affiliate` int(11) NOT NULL,
  `affiliate_data` text,
  `status` varchar(10) NOT NULL,
  `customer_email` text,
  `customer_name` text,
  `customer_id` varchar(40) DEFAULT NULL,
  `total` decimal(10,2) NOT NULL,
  `commission` decimal(10,2) NOT NULL,
  `date_entered` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`(20)),
  KEY `status` (`status`),
  KEY `orders_affiliate_date_entered` (`affiliate`,`date_entered`),
  KEY `orders_customer_id_date_entered` (`customer_id`,`date_entered`),
  CONSTRAINT `orders_ibfk_1` FOREIGN KEY (`affiliate`) REFERENCES `affiliates` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `orders_ibfk_2` FOREIGN KEY (`status`) REFERENCES `order_status` (`id`) ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `orders` */

/*Table structure for table `payments` */

DROP TABLE IF EXISTS `payments`;

CREATE TABLE `payments` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `affiliate` int(11) NOT NULL,
  `amount` decimal(10,2) NOT NULL,
  `date_entered` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `affiliate` (`affiliate`),
  CONSTRAINT `payments_ibfk_1` FOREIGN KEY (`affiliate`) REFERENCES `affiliates` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `payments` */

/*Table structure for table `recharge_orders` */

DROP TABLE IF EXISTS `recharge_orders`;

CREATE TABLE `recharge_orders` (
  `recharge_id` int(11) NOT NULL AUTO_INCREMENT,
  `recharge_user_id` int(11) DEFAULT NULL,
  `recharge_mobile` varchar(50) DEFAULT NULL,
  `recharge_amount` varchar(50) DEFAULT NULL,
  `recharge_rp_id` varchar(100) DEFAULT NULL,
  `recharge_agent_id` varchar(100) DEFAULT NULL,
  `recharge_op_id` varchar(100) DEFAULT NULL,
  `recharge_msg` text,
  `recharge_usage_points` int(50) DEFAULT NULL,
  `recharge_status` tinyint(5) DEFAULT NULL COMMENT '1-sucess,2-fail',
  `recharge_date` datetime DEFAULT NULL,
  PRIMARY KEY (`recharge_id`)
) ENGINE=InnoDB AUTO_INCREMENT=25 DEFAULT CHARSET=latin1;

/*Data for the table `recharge_orders` */

/*Table structure for table `relevance_worth_vote` */

DROP TABLE IF EXISTS `relevance_worth_vote`;

CREATE TABLE `relevance_worth_vote` (
  `relevance_worth_vote_id` int(20) NOT NULL AUTO_INCREMENT,
  `relevance` float DEFAULT NULL,
  `worth` float DEFAULT NULL,
  `voteUp` int(20) DEFAULT NULL,
  `voteDown` int(20) DEFAULT NULL,
  `category_id` int(20) DEFAULT NULL,
  `user_id` varchar(50) DEFAULT NULL,
  `created_date` datetime DEFAULT NULL,
  `updated_date` datetime DEFAULT NULL,
  `status` tinyint(4) DEFAULT NULL,
  `rw_lh` tinyint(4) DEFAULT NULL,
  PRIMARY KEY (`relevance_worth_vote_id`)
) ENGINE=InnoDB AUTO_INCREMENT=236 DEFAULT CHARSET=latin1;

