/*Table structure for table `setting_assending_type` */

DROP TABLE IF EXISTS `setting_assending_type`;

CREATE TABLE `setting_assending_type` (
  `setting_assending_type_id` int(11) NOT NULL AUTO_INCREMENT,
  `source` int(11) DEFAULT NULL,
  `destination` int(11) DEFAULT NULL,
  `position` int(11) DEFAULT NULL,
  `status` tinyint(1) DEFAULT NULL,
  `crated_date` datetime DEFAULT NULL,
  `update_date` datetime DEFAULT NULL,
  PRIMARY KEY (`setting_assending_type_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `setting_assending_type` */

