  `connection_circle_coordinates` varchar(30) DEFAULT NULL,
  `connection_fullcircle_coordinates` varchar(30) DEFAULT NULL,
  `status` tinyint(1) DEFAULT NULL,
  `created_date` datetime DEFAULT NULL,
  `updated_date` datetime DEFAULT NULL,
  PRIMARY KEY (`setting_inter_linking_type_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

