/*Table structure for table `affiliate_totals` */

DROP TABLE IF EXISTS `affiliate_totals`;

/*!50001 DROP VIEW IF EXISTS `affiliate_totals` */;
/*!50001 DROP TABLE IF EXISTS `affiliate_totals` */;

/*!50001 CREATE TABLE  `affiliate_totals`(
 `affiliate` int(11) ,
 `count` bigint(21) ,
 `total` decimal(32,2) ,
 `commission` decimal(32,2) 
)*/;

/*Table structure for table `daily_orders` */

DROP TABLE IF EXISTS `daily_orders`;

/*!50001 DROP VIEW IF EXISTS `daily_orders` */;
/*!50001 DROP TABLE IF EXISTS `daily_orders` */;

/*!50001 CREATE TABLE  `daily_orders`(
 `affiliate` int(11) ,
 `date_entered` date ,
 `count` bigint(21) ,
 `total` decimal(32,2) ,
 `commission` decimal(32,2) 
)*/;

/*View structure for view affiliate_totals */

/*!50001 DROP TABLE IF EXISTS `affiliate_totals` */;
/*!50001 DROP VIEW IF EXISTS `affiliate_totals` */;

/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `affiliate_totals` AS select `orders`.`affiliate` AS `affiliate`,count(0) AS `count`,sum(`orders`.`total`) AS `total`,sum(`orders`.`commission`) AS `commission` from `orders` where (`orders`.`status` in ('shipped','refunded','refund')) group by `orders`.`affiliate` */;

/*View structure for view daily_orders */

/*!50001 DROP TABLE IF EXISTS `daily_orders` */;
/*!50001 DROP VIEW IF EXISTS `daily_orders` */;

/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `daily_orders` AS select `orders`.`affiliate` AS `affiliate`,cast(`orders`.`date_entered` as date) AS `date_entered`,count(0) AS `count`,sum(`orders`.`total`) AS `total`,sum(`orders`.`commission`) AS `commission` from `orders` where (`orders`.`status` in ('new','shipped')) group by `orders`.`affiliate`,cast(`orders`.`date_entered` as date) */;

